import { useSelector } from "react-redux";

function PaymentPage() {
    const items = useSelector(state => state.ReduxProduct.Carts);

    return (
    <>
        {items.map(value =>{
            return(
                <div className="bg-white rounded-lg grid grid-cols-3 mx-9 p-4">
                    <div> 
                    <img src={value.imageUrl}/>
                    </div>
                    <div className="col-span-2 flex justify-center ">You have no products in cart</div>
                </div>
            )
        })}
     </>   
)
    }
export default PaymentPage;
